import React from 'react';
import Link from './Link';
import Photo from "./Photo"



const Nav = () => {


    return (
        <div className="nav-div">
            <Photo />
            <Link>Home</Link>
            <Link>About Me</Link>
            <Link>Contact</Link>
            <Link>Experience</Link>
            <Link>Find me</Link>
        </div>
    )

}

export default Nav;
